double wb2_check_residual(double *target, double *multiplicand) {
  /* Returns the squared 2-norm of lhs - A*rhs. */
  /* Reuses v to find the residual. */
  int i;
  double residual;
  residual = 0;
  wb2_matrix_multiply(wb2_work.v, multiplicand);
  for (i = 0; i < 111; i++) {
    residual += (target[i] - wb2_work.v[i])*(target[i] - wb2_work.v[i]);
  }
  return residual;
}
